const POEDB = "https://poedb.tw/us/"
const CRAFT_OF_EXILE = "https://www.craftofexile.com/?b={bid}&ob=both&v=d&a=e&l=a&lg=8&bp=y&as=1&bld={}&ggt=|&ccp={}"
const POEDB_IMG = "data:image/png;base64,";
const ENCH_IMG = "data:image/png;base64,";
const COE_IMG = "data:image/png;base64,";

// main
let infobox = $("span.infobox-page-container");
// exit if not on item page
if (infobox.length < 1) {
	return;
}

// get item info
let itemClass = infobox.find("span:nth-child(2) > span > span:last-child() > em.tc.-value").text();
let itemHeader = infobox.find("span:nth-child(1) > span.item-stats > span:nth-child(1)").text();
let str = itemHeader.includes("Armour");
let dex = itemHeader.includes("Evasion");
let int = itemHeader.includes("Energy Shield");
let stats = (str ? "str_" : "") + (dex ? "dex_" : "") + (int ? "int_" : "");
stats = stats.substring(0, stats.length - 1);
let name = infobox.find("span:nth-child(1) > span.header")[0].innerText.split("\n").at(-1);
let subtypes = [stats, name];

// find match in bases list
function findMatch(BASES, itemClass, subtypes) {
	console.log("looking for a match for: " + itemClass + subtypes);
	let base = null;
	for (let i = 0; i < BASES.length; i++) {
		base = BASES[i];
		// match item class
		if (itemClass == base[0]) {
			if (base[1] == null) {
				return base;
			}
			let regex = new RegExp(base[1]);
			for (let j = 0; j < subtypes.length; j++) {
				// match one of subtypes
				if (subtypes[j].match(regex)) {
					return base;
				}
			}
		}
	}
}

let base = findMatch(BASES, itemClass, subtypes);

if (!base) {
	let err = $("<span>No match found</span>");
	err.css({
		"float": "right",
		"font-size": "0.7em",
		"color": "red",
	});
	$("#firstHeading").append(err);
	console.error("No match found!");
	return;
}

let a_style = {
	"float": "right",
};
let img_style = {
	"width": "32px",
	"height": "32px",
	"padding": "2px",
}

if (base[4]) {
	let img = $(`<img src="${COE_IMG}">`);
	img.css(img_style);
	let craftOfExile = $(`<a href="${CRAFT_OF_EXILE.replace("{bid}", base[4])}">`);
	craftOfExile.css(a_style);
	craftOfExile.append(img);
	$("#firstHeading").append(craftOfExile);
}
if (base[3]) {
	let img = $(`<img src="${ENCH_IMG}">`);
	img.css(img_style);
	let poedbEnchants = $(`<a href="${POEDB + base[3]}">`);
	poedbEnchants.css(a_style);
	poedbEnchants.append(img);
	$("#firstHeading").append(poedbEnchants);
}
if (base[2]) {
	let img = $(`<img src="${POEDB_IMG}">`);
	img.css(img_style);
	let poedbMods = $(`<a href="${POEDB + base[2]}">`);
	poedbMods.css(a_style);
	poedbMods.append(img);
	$("#firstHeading").append(poedbMods);
}
